+----------------+
|Game Description|
+----------------+

Journey back in time to build the world's most magnificent structures such as Stonehenge and the Taj Mahal. Watch each wonder come to life piece-by-piece in this fun and educational match-3 challenge!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- Windows XP/Vista

- Pentium 800MHz

- 128MB RAM

- DirectX 8 or later

- Direct3D 8 compatible 16 or 32-bit Video Card with 16MB VRAM (64MB recommended)

- DirectSound compatible Sound Card

